import styles from './Navigation.module.scss';
import clsx from 'clsx';
import { Link } from 'react-router-dom';


const Navigation = () => {
  return (
    <div className={clsx("d-flex justify-content-between", styles.mynav)}>
      <div className="col-11"><h3><a className={styles.navoption} href="/">Waiter.app</a></h3></div>
      <div className="col-1 text-center pt-2"><Link to="/" className={styles.navoption}>Home</Link>
      </div>
    </div >
  );
};

export default Navigation;
<li><Link to="/">Home</Link></li>
